import React from 'react';

const MyComponent = (props) => {
    return (
        <nav className="navbar navbar-nav navbar-light bg-dark fontify">
                <i className=" big youtube icon red"/>
            <span>{props.children}</span>
        </nav>
    );
};

export default MyComponent;
